import React from 'react';

const Home = () => {
  return (
    <div class="content">
      <h1 class="title">SHAREHOME</h1>
      <p class="subtitle">a party game based on the hit Japanese reality TV show, Terrace House. Reenact or recreate your favorite scenes by playing as members of the show!</p>
    </div>
  );
}

export default Home;
